// Transform website crawl result
const input = $('Parse Input').first().json;
const crawlResults = $input.first().json || [];

// Detect CMS from meta tags or known patterns
function detectCMS(html) {
  if (!html) return null;
  if (html.includes('wp-content') || html.includes('wordpress')) return 'WordPress';
  if (html.includes('Shopify')) return 'Shopify';
  if (html.includes('wix.com')) return 'Wix';
  if (html.includes('squarespace')) return 'Squarespace';
  if (html.includes('webflow')) return 'Webflow';
  return null;
}

const firstPage = crawlResults[0] || {};
const allText = crawlResults.map(p => p.text || '').join(' ');

const websiteData = {
  cms: detectCMS(firstPage.html || ''),
  technologies: [], // Would need more analysis
  ssl: input.websiteUrl.startsWith('https'),
  mobileResponsive: true, // Assume true, would need viewport testing
  structuredData: (firstPage.html || '').includes('application/ld+json'),
  schemaTypes: [], // Would parse from structured data
  description: firstPage.description || null,
  title: firstPage.title || null,
  pages: crawlResults.slice(0, 20).map(page => ({
    url: page.url,
    title: page.title || '',
    wordCount: (page.text || '').split(/\s+/).length
  }))
};

return [{
  json: {
    sessionId: input.sessionId,
    callbackUrl: input.callbackUrl,
    step: 'website',
    status: 'completed',
    data: websiteData
  }
}];

// Transform sitemap result
const input = $('Parse Input').first().json;
const sitemapResults = $input.first().json || [];

// Categorize pages by URL patterns
function categorizeUrl(url) {
  const lower = url.toLowerCase();
  if (lower.includes('/service') || lower.includes('/what-we-do')) return 'services';
  if (lower.includes('/blog') || lower.includes('/news') || lower.includes('/article')) return 'blog';
  if (lower.includes('/location') || lower.includes('/area') || lower.includes('/city')) return 'locations';
  if (lower.includes('/about')) return 'about';
  if (lower.includes('/contact')) return 'contact';
  if (lower.includes('/faq')) return 'faq';
  return 'other';
}

const urls = Array.isArray(sitemapResults) ? sitemapResults : (sitemapResults.urls || []);
const pageTypes = {};

urls.forEach(item => {
  const url = typeof item === 'string' ? item : item.url;
  const type = categorizeUrl(url);
  pageTypes[type] = (pageTypes[type] || 0) + 1;
});

const sitemapData = {
  totalPages: urls.length,
  pageTypes,
  hasServicePages: (pageTypes.services || 0) > 0,
  hasBlog: (pageTypes.blog || 0) > 0,
  hasLocationPages: (pageTypes.locations || 0) > 0,
  recentlyUpdated: 0 // Would need lastmod parsing
};

return [{
  json: {
    sessionId: input.sessionId,
    callbackUrl: input.callbackUrl,
    step: 'sitemap',
    status: 'completed',
    data: sitemapData
  }
}];

// Transform PageSpeed result to SEO audit format
const input = $('Parse Input').first().json;
const psResult = $input.first().json;

let seoData = null;

try {
  const lighthouse = psResult.lighthouseResult;
  const categories = lighthouse?.categories || {};
  const audits = lighthouse?.audits || {};

  seoData = {
    score: Math.round((categories.seo?.score || 0) * 100),
    mobile: {
      score: Math.round((categories.performance?.score || 0) * 100),
      usability: (audits['viewport']?.score || 0) === 1,
      viewport: (audits['viewport']?.score || 0) === 1,
      textSize: (audits['font-size']?.score || 0) >= 0.9
    },
    performance: {
      score: Math.round((categories.performance?.score || 0) * 100),
      lcp: audits['largest-contentful-paint']?.numericValue || 0,
      fid: audits['max-potential-fid']?.numericValue || 0,
      cls: audits['cumulative-layout-shift']?.numericValue || 0,
      ttfb: audits['server-response-time']?.numericValue || 0
    },
    technical: {
      ssl: input.websiteUrl.startsWith('https'),
      canonicalTag: (audits['canonical']?.score || 0) === 1,
      robotsTxt: (audits['robots-txt']?.score || 0) === 1,
      sitemap: true, // Assume if we got sitemap data
      structuredData: audits['structured-data']?.details?.items?.map(i => i.type) || [],
      metaDescription: (audits['meta-description']?.score || 0) === 1,
      h1Tags: 1 // Would need more parsing
    },
    content: {
      wordCount: 0, // From website crawl
      headings: 0,
      images: audits['image-alt']?.details?.items?.length || 0,
      imagesWithAlt: 0,
      internalLinks: 0,
      externalLinks: 0
    }
  };
} catch (e) {
  // PageSpeed failed, return minimal data
  seoData = {
    score: 0,
    mobile: { score: 0, usability: false, viewport: false, textSize: false },
    performance: { score: 0, lcp: 0, fid: 0, cls: 0, ttfb: 0 },
    technical: { ssl: input.websiteUrl.startsWith('https'), canonicalTag: false, robotsTxt: false, sitemap: false, structuredData: [], metaDescription: false, h1Tags: 0 },
    content: { wordCount: 0, headings: 0, images: 0, imagesWithAlt: 0, internalLinks: 0, externalLinks: 0 }
  };
}

return [{
  json: {
    sessionId: input.sessionId,
    callbackUrl: input.callbackUrl,
    step: 'seo',
    status: 'completed',
    data: seoData
  }
}];

